getPSDEDQConditions.condition:
EXISTS (
    SELECT 1 
    FROM `test_case` 
    LEFT JOIN `run` ON `test_case`.`ID` = `run`.`CASE_ID`
) and NOT EXISTS (
    SELECT 1 
    FROM `run` 
    WHERE `run`.`CASE_ID` = #{ctx.webcontext.test_case}
    AND `run`.`PLAN_ID` = t1.`ID`
)

getPSDELogicNodes.sql:
UPDATE test_plan
SET categories = TRIM(BOTH ',' FROM REPLACE(CONCAT(',', categories, ','), CONCAT(',', ?, ','), ','))
WHERE FIND_IN_SET(?, categories) > 0 ;
